(7,	5,	'Extremely Helpful Free Graphic Design Courses',	NULL,	'3',	NULL,	NULL,	'Looking to learn graphic design or brush up on your skills without shelling out tuition? Check out our picks for some of the best free graphic design courses.',	NULL,	'10:30:pm',	NULL),
