(10,	5,	'Udemy: Introduction to Graphic Design',	NULL,	'3',	NULL,	NULL,	'The site is well-organized so its easy to navigate and find the lessons you are looking for. In addition, since MITs OpenCourseWare is a not-for-profit initiative, you never have to deal with any ads or marketing sales pitches for subscription plans.',	NULL,	'00:00:00',	NULL),
(11,	5,	'A Brief History of Typography',	NULL,	'2',	NULL,	NULL,	'Typography is key to the work of a graphic designer. In almost all instances of graphic design, you will see some use of type. Each font adds a different feeling and style to a design. So choosing a font can make or break your design project.',	NULL,	'00:00:00',	NULL),
(12,	5,	'Teach Yourself Graphic Design: A Self-Study Course Outline',	NULL,	'2',	NULL,	NULL,	'This article outlines all the resources you need to create a self-taught graphic design course to replace a traditional education. Its written by Sean Hodge, whos currently the Business Editor for the Tuts+ educational network. He also has experience build',	NULL,	'00:00:00',	NULL),
