(5,	NULL,	'standard',	'{\"en\":\"new strivre\"}',	'new-strivre',	'{\"en\":\"Meaningful paid work ​while you study\"}',	'app/letest_news/b5a47c232fe014dd147f0121a7c08e17.jpeg',	'{\"en\":\"<p><span style=\\\"color: #343e52; font-family: Roboto, sans-serif; font-size: 16px; background-color: #ffffff;\\\">Strivers are a Tribe of early career job seekers looking to maximise their connections within the financial planning, accounting and broader financial services industry, while enjoying the no nonsense, personal coaching by a dedicated Striver mentor to kick-start their professional career.<\\/span><\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p><span style=\\\"font-family: Roboto; font-size: 16px; background-color: rgba(255, 255, 255, 0.95);\\\">With a growing community of Striver Businesses across Australia, you have the opportunity to gain valuable and relevant work experience while you complete your university studies. Whether you have defined your career goals, or want to explore your opportunities, we are here to work with you to kick-start your professional career.<\\/span><\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p><span style=\\\"color: #0b162d; font-family: Roboto, sans-serif; font-size: 16px; background-color: #ffffff;\\\">Let us provide you with a practice of what will be the first of many of these types of assessments that you will complete in your career.&nbsp;<\\/span><\\/p>\"}',	NULL,	NULL,	NULL,	0,	'{\"en\":null}',	'{\"en\":null}',	'{\"en\":null}',	NULL,	NULL,	NULL,	0,	1,	'2022-03-02 00:04:22',	'2022-03-02 00:04:22'),
(6,	NULL,	'standard',	'{\"en\":\"striver main\"}',	'striver-main',	'{\"en\":\"striver main\"}',	NULL,	'{\"en\":\"<p><span style=\\\"font-family: Roboto; font-size: 16px; background-color: rgba(255, 255, 255, 0.95);\\\">With a growing community of Striver Businesses across Australia, you have the opportunity to gain valuable and relevant work experience while you complete your university studies. Whether you have defined your career goals, or want to explore your opportunities, we are here to work with you to kick-start your professional career.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-family: Roboto; font-size: 16px; background-color: rgba(255, 255, 255, 0.95);\\\">With a growing community of Striver Businesses across Australia, you have the opportunity to gain valuable and relevant work experience while you complete your university studies. Whether you have defined your career goals, or want to explore your opportunities, we are here to work with you to kick-start your professional career.<\\/span><\\/p>\"}',	NULL,	NULL,	NULL,	0,	'{\"en\":null}',	'{\"en\":null}',	'{\"en\":null}',	NULL,	NULL,	NULL,	0,	1,	'2022-03-02 01:51:34',	'2022-03-02 01:51:34');
