(27,	'IN',	'1',	'The digital marketing landscape is changing rapidly. This course acts as an introduction to the wide array of options available to marketers in the digital marketing landscape. Twenty years ago social media didnt even exist and only 10 years ago marketers started to understand how they could leverage popular social sites to market their products and services.',	'',	NULL,	2,	1,	'Coach1',	NULL,	NULL,	'+919988776633',	0,	'coach29931',	'coach1@gmail.com',	NULL,	'$2y$10$qZcz81dlNBC12jH3JawwVuguOd34A/rWDw7t4Fmdx0YeH8PVmdDB2',	NULL,	0,	1,	0,	NULL,	NULL,	NULL,	NULL,	'37',	'38',	'2',	NULL,	NULL,	1,	1,	1,	0,	NULL,	0,	0,	NULL,	NULL,	NULL,	'2022-04-08 06:40:02',	'2022-04-08 07:01:11'),
(28,	'UK',	'7',	'Project management is an exciting place to be. This course is designed for people that are new to project management. This course is structured to give you a solid foundation of project management and to help you speak the project management language.',	'',	NULL,	2,	NULL,	'Coaches2',	'avatars/uk/28/0f22853f9590be7efbe69fcfd00cff25.jpg',	NULL,	'+445566774433',	0,	'coach49628',	'coaches2@gmail.com',	NULL,	'$2y$10$LYsu1f4gCMmMVCgM2SQgCeQGXF4fc3JGi1Kp6U4cDJA6hxdQG/k.i',	NULL,	0,	1,	0,	NULL,	NULL,	NULL,	NULL,	'9',	'10',	'5',	NULL,	NULL,	1,	1,	1,	0,	NULL,	0,	0,	NULL,	'2022-04-08 19:25:41',	NULL,	'2022-04-08 07:08:20',	'2022-04-08 13:57:00'),
(29,	'US',	'12',	'Drawing is a skill that is learned and developed Drawing as formal artistic creation might be defined as the primarily linear rendition of objects in the visible world, as well as of concepts, thoughts, attitudes, emotions, and fantasies given visual form, of symbols and even of abstract forms.',	'',	NULL,	2,	NULL,	'Eric Coach',	NULL,	NULL,	'03456789874',	0,	'coach56374',	'Eric@gmail.com',	NULL,	'$2y$10$GUoi6zXjG4UjJrK6akGmi.dL7gzjp3R5p0d7GFJMw9SsCqq/K.Xyy',	NULL,	0,	1,	0,	NULL,	NULL,	NULL,	NULL,	'138',	'138',	NULL,	NULL,	NULL,	1,	1,	1,	0,	NULL,	0,	0,	NULL,	'2022-04-08 18:52:52',	NULL,	'2022-04-08 08:59:31',	'2022-04-08 13:22:52'),
(30,	'IN',	'1',	'Quality management ensures that an organization, product or service is consistent. It has four main components: quality planning, quality assurance, quality control and quality improvement. Quality management is focused not only on product and service quality, but also on the means to achieve it.',	'',	NULL,	2,	1,	'Coach4',	NULL,	NULL,	'+914354654433',	0,	'coach43088',	'coach4@gmail.com',	NULL,	'$2y$10$epU51gBt6ZvQnguEUl0jz.RuY1e2PcuuPoqOk3ovcAO6NSLsqvvU.',	NULL,	0,	1,	0,	NULL,	NULL,	NULL,	NULL,	'73',	'74',	'4',	NULL,	NULL,	1,	1,	1,	0,	NULL,	0,	0,	NULL,	'2022-04-11 10:23:39',	NULL,	'2022-04-08 09:07:48',	'2022-04-11 04:54:02'),
(31,	'UK',	'7',	'Software development refers to a set of computer science activities dedicated to the process of creating, designing, deploying and supporting software. Software itself is the set of instructions or programs that tell a computer what to do. It is independent of hardware and makes computers programmable.',	'',	NULL,	2,	NULL,	'Samual Lio',	NULL,	NULL,	'06677885544',	0,	'coach71058',	'samual@gmail.com',	NULL,	'$2y$10$yYiwGt5aLvokoDO2V21itu95277BFyHaoXGLlulobCpvqu/7xDra2',	NULL,	0,	1,	0,	NULL,	NULL,	NULL,	NULL,	'54',	'1',	'5',	NULL,	NULL,	1,	1,	1,	0,	NULL,	0,	0,	NULL,	NULL,	NULL,	'2022-04-08 09:27:38',	'2022-04-08 09:34:33'),
